    const resource = resources.find((r)=>r.type === activityType);
    const activity = activities.find((a)=>a.resource_type === activityType);
    if (!resource || !activity) {
        return {
            available: 99,
            total: 99
        };
    }
    const bookedGuests = bookings.filter((b)=>b.date === date && b.activity_type === activityType && b.status !== "cancelled").reduce((sum, b)=>sum + b.guests, 0);
